                    <label htmlFor='name'><i className="zmdi zmdi-account material-icons-name"></i></label>
                    <input type='text' autoComplete='off' name='name' value={user.name} onChange={handleInputs} placeholder='name'/>
                </div>
        </form>
    </div>
    </>
  );
}

export default UserInput;
